import React from "react";
import { makeStyles, Typography, Toolbar } from "@material-ui/core";


import styles from "../styles/EditSurveyPageStyle";

import AppHeader from "../components/AppHeader";
import AppDrawer from "../components/AppDrawer";

const useStyles = makeStyles(styles);


export default function EditSurveyPage(props) {

    const classes = useStyles();
    const [drawerOpen, setDrawerOpen] = useState(false);

    console.log(props);



    const handleDrawerOpen = (e) => {
        setDrawerOpen(true);
    }
    
    const handleDrawerClose = e => {
    setDrawerOpen(false);
    }

    return (
        <React.Fragment>
        <AppHeader />
        <AppDrawer open={drawerOpen} handleDrawerClose={handleDrawerClose} />
        <Toolbar />
        <Typography> Survey {props.match.params.survid} Edit Page</Typography>
        </React.Fragment>
    )

}
